import React from "react";
import { NavLink } from "react-router-dom";
import {styledNav} from "./Nav.Styled";

export default function Nav() {
  return (
    <styledNav>
      <NavLink exact to="/">
        Home
      </NavLink>
      <NavLink to="/authors">
        Authors
      </NavLink>
    </styledNav>
  );
}
